import PrevButtonLayout from './PrevButtonLayout'

const layoutStyle = {
  textAlign:'center'
};

const Layout = props => (
  <div style={layoutStyle}>
    <p>This is formatted.</p>
    {props.children}
    <span>
    <NextButtonLayout />
    <PrevButtonLayout />
    </span>
  </div>
);

export default Layout;
